		function Stem() {
			$this->request_words = preg_split("/[\s\.,\-;:]+/", $this->request_text);
			for($i=0;$i<count($this->request_words);$i++) {
				$this->request_words[$i] = trim($this->request_words[$i]);
				if(Helper_UTF8::Strlen($this->request_words[$i]) > $this->min_strlen && !in_array($this->request_words[$i], $this->denied_words)) {
					$this->request_words[$i] = $this->djem->db->Escape($this->stemmer->stem_word($this->request_words[$i]));
				} else {
					$this->request_words[$i] = false;
				}
			}
			$this->request_words = array_values(array_filter($this->request_words));
		}
		
		function Total() {
			if(count($this->request_words) > 0) {
				if($this->result_total === false) {
					$query = "	SELECT
									ds.djem_srch_doc_id as document_id
								FROM
									djem_srch as ds
									LEFT JOIN djem_words as dw ON dw.djem_word_id = ds.djem_srch_word_id
									LEFT JOIN djem_fields as df ON ds.djem_srch_field_id = df.djem_field_id";
					$query .= "		LEFT JOIN documents as d ON ds.djem_srch_doc_id = d.document_id";
					$query .= "	WHERE
									dw.djem_word_text IN ('" . implode("','", $this->request_words) . "')
									AND d.document_deleted = 0";
					if($this->request_path != "") {
						$query .= " AND d.document_path LIKE '" . $this->request_path . "%'";
					}
					if(count($this->result_denied_folders) > 0) {
						$query .= " AND d.document_path NOT LIKE '" . implode("' AND d.document_path NOT LIKE '", $this->result_denied_folders) . "'";
					}
					$query .= "	GROUP BY
									ds.djem_srch_doc_id";
					
					$result = $this->djem->Query($query);
					if($result->Fetch()) {
						$this->result_total = $result->Size();
						$this->result_total_pages = ceil($this->result_total/$this->result_per_page);
					}
				}
			} else {
				$this->result_total = 0;
			}
			return $this->result_total;
		}
		
		function FindIDs($string) {
			$this->request_text = $string;
			$this->Stem();
			if(count($this->request_words) > 0) {
				$this->Total();
				$this->djem->Query("DROP TEMPORARY TABLE IF EXISTS results");
				$this->djem->Query("CREATE TEMPORARY TABLE results (document_id int unsigned, `fields` char(255), cnt int unsigned, power int unsigned)");
	
				$query = "INSERT INTO results SELECT
								ds.djem_srch_doc_id as document_id,
								GROUP_CONCAT(DISTINCT df.djem_field_name),
								count(dw.djem_word_id) as relevance";
				if(count($this->result_fields_weight)) {
					$query .= ", MAX(CASE (df.djem_field_name) ";
					foreach($this->result_fields_weight as $field => $power) {
						$query .= "	WHEN ('".$field."') THEN " . $power . " ";
	                  				
					}
					$query .= "END) as power";
				}
				$query .= "	FROM
								djem_srch as ds
								LEFT JOIN djem_words as dw ON dw.djem_word_id = ds.djem_srch_word_id
								LEFT JOIN djem_fields as df ON ds.djem_srch_field_id = df.djem_field_id";
				$query .= "		LEFT JOIN documents as d ON ds.djem_srch_doc_id = d.document_id";
				$query .= "	WHERE
								dw.djem_word_text IN ('" . implode("','", $this->request_words) . "')
								AND d.document_deleted = 0
							";
				if($this->request_path != "") {
					$query .= " AND d.document_path LIKE '" . $this->request_path . "%'";
				}
				if(count($this->result_denied_folders) > 0) {
					$query .= " AND d.document_path NOT LIKE '" . implode("' AND d.document_path NOT LIKE '", $this->result_denied_folders) . "'";
				}
				$query .= "	GROUP BY
								ds.djem_srch_doc_id,dw.djem_word_text";
				
				$this->djem->Query($query);
				$query = "SELECT
								document_id,
								`fields`,
								cnt,
								power,
								COUNT(document_id) * power as weight
							FROM
								results
							GROUP BY
								document_id
							ORDER BY
								weight DESC
							LIMIT ?,?";
				$result = $this->djem->Query($query, ($this->request_page - 1) * $this->result_per_page, $this->result_per_page);
				while($result->Fetch()) {
					$this->result_document_fields[$result->document_id] = $result->fields;
				}
				
				return $this->result_document_fields;
			}
			return array();
		}
		
		function Highlight($text, $tag_start = "<strong>", $tag_stop = "</strong>") {
			$shift = 150;
			if(count($this->request_words) > 0) {
				$text = preg_replace("/([^\s]*".implode("[^\s]*|[^\s]*", $this->request_words)."[^\s]*)/iu", " ".$tag_start."$1".$tag_stop." ", $text);
			}
			$str_pos = Helper_UTF8::Strpos($text, $tag_start);
			if($str_pos - 50 > 0) {
				$str_pos01 = Helper_UTF8::Strpos($text, " ", $str_pos - 50);
			} else {
				$str_pos01 = 0;
			}
			if($str_pos + $shift*2 < Helper_UTF8::Strlen($text)) {
				$str_pos02 = Helper_UTF8::Strpos($text, " ", $str_pos + $shift*2);
			} else {
				$str_pos02 = Helper_UTF8::Strlen($text);
			}
			$str_pos = ($str_pos - $shift < 0) ? 0 : $str_pos - $shift;
			$text = Helper_UTF8::Substr($text, $str_pos01, $str_pos02 - $str_pos01);
			return $text;
		}
